function hTopN=getDoubleSinComp(hN,slRate)
    p=pir(hN.getCtxName);
    hTopN=addNetworks(p);
    createNetworks(p,slRate);
end

function hTopN=addNetworks(p)
    hN=p.addNetwork;
    hN.Name='Sin';
    hN.FullPath='Sin';
    hTopN=hN;
end

function createNetworks(p,slRate1)
    hN_n0=p.findNetwork('fullname','Sin');
    createNetwork_n0(p,hN_n0,slRate1);
end

